import React, {Component} from 'react';
import {VideoTool} from "react-annotation-tool"
import { Container, Row, Col, Card, CardBody, CardTitle, CardText } from 'reactstrap';

class Demo extends Component {
	constructor(props){
		super(props)
		this.state = {result: null}
	}

	handleSubmit = r =>{
		this.setState({
			result: r
		})
	}


	render() {
